import {StyleSheet} from 'aphrodite';
const styles = StyleSheet.create({
    wrap:{
        padding: '20px',
        fontFamily: "SFUIDisplay-Light",
        fontSize: "15px",
        lineHeight: "30px",
        fontWeight: 300,
        display: "flex",
        flexDirection: "row"
    },
    wblock:{
        width: '50%'
    },
    wrap2:{
        padding: '20px',
        marginTop: "30px"
    },
    h:{
        fontFamily: "SFUIDisplay-Light",
        fontSize: "24px",
        fontWeight: 300
    },
    t:{
        marginTop: "10px",
        color: "#acacac",
        lineHeight: "33px",
        fontSize: "15px",
        fontFamily: "SFUIDisplay-Light",
        fontWeight: 300
    }
});
export default styles;
